def _combo_helper(text, items):
    if not isinstance(items, list):
        items = [items]
    for item in items:
        if isinstance(item, re.Pattern):
            if not item.search(text):
                return False
        else:
            matches = (item[1:] not in text) if item.startswith(
                '~') else (item in text)
            if not matches:
                return False
    return True


def combo_detect(text, combinations):
    if isinstance(text, list):
        # Multiple arguments specified, so we perform zipped-comparisons
        gen = (
            all(_combo_helper(t, i) for t, i in zip(text, item))
            for item in combinations
        )
    else:
        gen = (_combo_helper(text, item) for item in combinations)
    return any(gen)


def flag(comment):
    # Start by scanning author name
    author_name = replace_whitespace_with_spaces(comment.author_name)
    author_name = remove_unicode_categories(author_name)

    if INVALID_USERNAMES.search(author_name):
        return CommentLabel.SCAM
    if INVALID_NOVID_USERNAMES.search(author_name):
        return CommentLabel.SELF_PROMO
    if INVALID_AD_USERNAMES.search(author_name):
        return CommentLabel.SCAM

    normalised_author_name = normalise(author_name)
    if combo_detect(normalised_author_name, SCAM_AUTHOR_COMBOS):
        return CommentLabel.SCAM

    # Remove multiple whitespace and invisible chars
    # NOTE: do not use string.normalize yet
    text = replace_whitespace_with_spaces(comment.text)
    # https://stackoverflow.com/a/49695605/17312053
    text = ''.join(k if k in BUFFER_CHARS else ''.join(v)
                   for k, v in itertools.groupby(text, lambda c: c))
    text = remove_unicode_categories(text)

    # TODO: if sub_confirmation in text: self promo
    if TEXT_BLACK_WORDS.search(text):
        return CommentLabel.SCAM

    normalised_text = normalise(text)
    if TEXT_EXACT_BLACK_WORDS.search(normalised_text):
        return CommentLabel.SCAM

    if combo_detect(normalised_text, SCAM_TEXT_COMBOS):
        return CommentLabel.SCAM

    if combo_detect([normalised_author_name, normalised_text], SCAM_NAME_TEXT_COMBOS):
        return CommentLabel.SCAM

    if combo_detect(normalised_text, KNOWN_SPAM_COMBOS):
        return CommentLabel.OTHER_SPAM

    combined = author_name + ' ' + text

    if len(ONLY_NUM_REGEX.findall(combined)) >= 6:
        return CommentLabel.SCAM
    if PHONE_NUM_REGEX.search(combined):
        return CommentLabel.SCAM

    # Links
    if combo_detect(normalised_text, LINK_SPAM_COMBOS):
        return CommentLabel.LINK_SPAM

    contains_url, exact_url = validate_url(text)
    if exact_url:
        return CommentLabel.LINK_ONLY

    if contains_url:
        return CommentLabel.LINK_CONTAINS

    return CommentLabel.VALID


def main():
    from tqdm import tqdm

    from shared import PROMPT_OPTIONS, handle_input
    from database import CommentDatabase

    # Load database
    database = CommentDatabase()

    all_comments = list(database.get_comments_sql(
        'SELECT * FROM comments WHERE moderated=FALSE and label="SCAM"',
        shuffle=True
    ))

    require_moderation = True
    skip_if_valid = False

    if require_moderation:

        # Will ask the user to moderate comments
        author_dict = {}
        for comment in tqdm(all_comments):
            prediction = flag(comment).name
            if skip_if_valid and prediction == 'VALID':
                continue

            if comment.author_channel_id not in author_dict:
                author_dict[comment.author_channel_id] = []

            author_dict[comment.author_channel_id].append(
                (comment, prediction))

        author_dict = dict(
            sorted(author_dict.items(), key=lambda x: len(x[1]), reverse=True))
        for author, comments in tqdm(author_dict.items()):

            comments = sorted(comments, key=lambda x: x[0].text)

            print(f'Found {len(comments)} flagged comments from {author}')

            for comment, prediction in comments[:3]:
                print(' ', comment)
            print('  ...')
            for comment, prediction in comments[-3:]:
                print(' ', comment)

            _, prediction = comments[0]
            response = handle_input(
                f'Assign label to comments from this user:\n  (0) {prediction}\n' +
                PROMPT_OPTIONS +
                f'\nEnter choice (0-{len(CommentLabel)}), or leave empty to ignore: ',
                custom_options=['0']
            )

            if not response:
                continue

            if response == '0':
                response = prediction
            else:
                response = response.name

            comments_to_update = []
            for comment, _ in comments:
                comment.label = response
                comment.moderated = True

                comments_to_update.append(comment)

            database.update(comments_to_update, force_save=True)
            print('Updated comments')

    else:
        counts = {
            i.name: 0
            for i in CommentLabel
        }
        with tqdm(all_comments) as progress:
            for comment in progress:
                prediction = flag(comment).name
                counts[prediction] += 1
                comment.label = prediction

        print(f'{counts=}')
        database.update(all_comments, force_save=True)


if __name__ == '__main__':
    main()
